version: '3.3'
services:
  nginx: 
    image: nginx:latest
    ports:
      - "80:80"
      - "8080:8080"
    volumes:
      - ./nginx.conf:/etc/nginx/nginx.conf
    depends_on:
      - master
      - wallet
      - node1
      - node2
  wallet:
    image: node:11
    volumes:
      - wallet-sync:/usr/src/service
      - wallet_node_modules:/user/src/service/node_modules
    working_dir: /usr/src/service
    command: bash -c "npm install && npm start"
  master:
    build:
      context: ../build-dev/
    privileged: true
    command: /opt/keto/run_keto.sh
    environment:
      - KETO_account_hash=D594F22DC389E38B3DE7FA5630DBD9DCA16DA8A77097516FD37F9E25C6BE24D2
      - KETO_public_
      - KETO_private_
      - KETO_consensus_,,,,,,,,,,,,,,,,,,,,,,,
      - KETO_rpc_peer=EMPTY
      - KETO_IS_MASTER=TRUE
    volumes:
      - ../../build/install/bin/:/opt/keto/bin/
      - ../../build/install/lib/:/opt/keto/lib/
      - ../../build/install/shared/:/opt/keto/shared/
      - ../../build/install/config/genesis.json:/opt/keto/config/genesis.json
      - master-data:/opt/keto/data/
  node1:
    build:
      context: ../build-dev/
    privileged: true
    command: /opt/keto/run_keto.sh
    environment:
      - KETO_rpc_peer=master
      - KETO_consensus_keys=
    volumes:
      - ../../build/install/bin/:/opt/keto/bin/
      - ../../build/install/lib/:/opt/keto/lib/
      - ../../build/install/shared/:/opt/keto/shared/
      - node1-data:/opt/keto/data/
    depends_on:
      - master
  node2:
    build:
      context: ../build-dev/
    privileged: true
    command: /opt/keto/run_keto.sh
    environment:
      - KETO_rpc_peer=master
      - KETO_consensus_keys=
    volumes:
      - ../../build/install/bin/:/opt/keto/bin/
      - ../../build/install/lib/:/opt/keto/lib/
      - ../../build/install/shared/:/opt/keto/shared/
      - node2-data:/opt/keto/data/
    depends_on:
      - master

volumes:
  wallet_node_modules:
  data_node_modules:
  master-data:
  node1-data:
  node2-data:
  wallet-sync:
    external: true
